import React from 'react';
import './App.css';

const App = () => {
  return (
    <div>
      <div><Header /></div>
    <div>
      <nav>
        <ul>
          <li><a href="">Главная</a></li>
          <li><a href="" >Авторизация</a></li>
          <li><a href="">Профиль</a></li>
          <li><a href="inf.html">Информация</a></li>
        </ul>
      </nav>
    </div>
    </div>
  );
}

const Header = () => {
  return (
    <div>
       <a>Home</a>
    </div>
  );
}


export default App;
